//import axios from 'axios';
import React from 'react';


const UpdateRecord = () => {
    return (
        <div className="update">
            <h1>Update Record</h1>
            <form>
                <table>
                    <tr>
                    <label for="patientid">Patient ID</label>
                     <input type="text" id="patientid" name="patientid" value="id" readonly></input>
                     <label for="patientname">Patient Name</label>
                     <input type="text" id="patientname" name="patientname" value="name" readonly></input>
                    </tr>
                </table>


            </form>

        </div>
    )
}

export default UpdateRecord;
